  \"2016-05-12T22:54:32.049302\",\n\t\"name\": \"iowa-fire-department-census\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a subset of the National
  Fire Department Census which provides an address listing of U.S. fire departments
  registered with U.S. Fire Administration (USFA) as well as some basic information
  about each fire department.  The purpose of the census is to create a national database
  for use by the fire protection and prevention communities, allied professions, the
  general public and the U.S. Fire Administration (USFA). USFA uses the database to
  conduct special studies, guide program decisionmaking, and to improve direct communication
  with individual fire departments.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
